var esq = new EntitySchemaQuery(UserConnection.EntitySchemaManager, "AtnRealty");
var priceColumn = esq.AddColumn("AtnPriceUSD");  // SELECT AtnPriceUSD, AtnArea FROM UsrRealty WHERE ...
var areaColumn = esq.AddColumn("AtnArea");

Guid typeId = Get<Guid>("RealtyTypeIdParameter");
Guid offerTypeId = Get<Guid>("RealtyOfferTypeIdParameter");

var typeFilter = esq.CreateFilterWithParameters(FilterComparisonType.Equal, "AtnType", typeId);
esq.Filters.Add(typeFilter);

var offerTypeFilter = esq.CreateFilterWithParameters(FilterComparisonType.Equal, "AtnOfferType", offerTypeId);
esq.Filters.Add(offerTypeFilter); // ... WHERE AtnTypeId = :typeId AND AtnOfferTypeId = :offerTypeId

string sqlText = esq.GetSelectQuery(UserConnection).GetSqlText();
Set("SqlTextParameter", sqlText);

var entityCollection = esq.GetEntityCollection(UserConnection);
decimal totalUSD = 0;
decimal totalArea = 0;
foreach(var entity in entityCollection) {
	decimal price = entity.GetTypedColumnValue<decimal>(priceColumn.Name); // reading using column alias
	decimal area = entity.GetTypedColumnValue<decimal>(areaColumn.Name); // reading using column alias
	totalUSD = totalUSD + price;
	totalArea = totalArea + area;
}

decimal result = 0;
if (totalArea > 0) {
	result = totalUSD / totalArea;
}

Set("AvgPriceUSDParameter", result);

return true;
